import profile_pic from './../../profile_pic.JPEG'
function Discord(){
    const profilePic = require('./../../profile_pic.JPEG');
    //<img className='w-6/12 h-1/12 rounded-lg' src={profilePic} />
    return (
        <div className='mt-36 mr-44 w-1/3 bg-slate-700 rounded-lg'>
                <div className='bg-red-700 w-full rounded-t-lg h-1/3'>

                </div>
                <div className='overfill-hidden'>
                    <img className='h-12 w-12 rounded-full' src={profilePic} />
                </div>

		</div>
    )
}
export default Discord;
